import axios from 'axios';
import React, { useEffect, useState } from 'react'

const videos = ({id}) => {

    let url = `https://api.jikan.moe/v3/anime/${id}/videos`;

    const [videos, setVideos] = useState([]);

    useEffect(()=>{
        (async function()
        {
            try
            {
                const res = await axios.get(url);
            }
            catch(err)
            {
                console.log(err);
            }
        })()
    });

    return (
        <div>
            
        </div>
    )
}

export default videos;
